import React, { Component } from 'react';

class MenuItems extends Component{
    constructor(props){
        super(props);
        this.state = {
            visible:false
        }
    }
    render(){
        return (
            <div className = 'Categoria'>
                <li>
                    <a href = '#'>{this.props.name}</a>
                </li>
            </div>
        );
    }
}

export default MenuItems;
